import axios from "axios";
import { setTeam, setTeamData } from "../index";

export function getTeamData(payload) {
  return (dispatch, getState) => {
    axios.get(`/api/teamData/${payload}`).then(res => {
      console.log(res);
      dispatch(setTeam(res.data[0]));
    });
  };
}
